DROP TABLE IF EXISTS `areatriggers`;
CREATE TABLE `areatriggers` (
	`m_id` INT NOT NULL DEFAULT '0',
	`m_mapId` INT NOT NULL DEFAULT '0',
	`m_posX` FLOAT NOT NULL DEFAULT '0',
	`m_posY` FLOAT NOT NULL DEFAULT '0',
	`m_posZ` FLOAT NOT NULL DEFAULT '0',
	`field5` INT NOT NULL DEFAULT '0',
	`field6` INT NOT NULL DEFAULT '0',
	`field7` INT NOT NULL DEFAULT '0',
	`field8` FLOAT NOT NULL DEFAULT '0',
	`field9` FLOAT NOT NULL DEFAULT '0',
	PRIMARY KEY (`m_id`)
);

